import React, { useEffect, useRef } from 'react';

const SkillTree = () => {
  const canvasRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext('2d');

    const resizeCanvas = () => {
      canvas.width = canvas.offsetWidth;
      canvas.height = canvas.offsetHeight;
    };

    resizeCanvas();
    window.addEventListener('resize', resizeCanvas);

    // Draw skill tree connections
    const drawConnections = () => {
      ctx.strokeStyle = 'rgba(65, 105, 225, 0.3)';
      ctx.lineWidth = 2;

      // Core skills connections
      ctx.beginPath();
      ctx.moveTo(150, 100); // Unity
      ctx.lineTo(150, 200); // AR/VR
      ctx.stroke();

      ctx.beginPath();
      ctx.moveTo(150, 200); // AR/VR
      ctx.lineTo(150, 300); // Multiplayer
      ctx.stroke();

      // Side branches
      ctx.beginPath();
      ctx.moveTo(150, 200); // AR/VR
      ctx.lineTo(50, 250); // Project Management
      ctx.stroke();

      ctx.beginPath();
      ctx.moveTo(150, 200); // AR/VR
      ctx.lineTo(250, 250); // Design Patterns
      ctx.stroke();

      ctx.beginPath();
      ctx.moveTo(150, 300); // Multiplayer
      ctx.lineTo(50, 350); // Game Design
      ctx.stroke();

      ctx.beginPath();
      ctx.moveTo(150, 300); // Multiplayer
      ctx.lineTo(250, 350); // Unity (Master)
      ctx.stroke();
    };

    drawConnections();

    return () => {
      window.removeEventListener('resize', resizeCanvas);
    };
  }, []);

  const skills = [
    {
      id: 'unity',
      name: 'Unity',
      level: 'Level 95 (MASTER)',
      icon: '🎮',
      unlocked: true,
      master: true,
      position: 'center-top',
      description: 'Master of Unity Engine with 4+ years of experience in game development, AR/VR, and real-time applications.'
    },
    {
      id: 'ar-vr',
      name: 'Augmented Reality',
      level: 'Level 95 (MASTER)',
      icon: '🔮',
      unlocked: true,
      master: true,
      position: 'center-middle',
      description: 'Expert in AR Foundation, Vuforia, and custom AR solutions. Created multiple AR applications and experiences.'
    },
    {
      id: 'vr',
      name: 'Virtual Reality',
      level: 'Level 90 (MASTER)',
      icon: '🥽',
      unlocked: true,
      master: true,
      position: 'center-middle',
      description: 'Proficient in VR development using Unity XR, Oculus SDK, and SteamVR. Built immersive VR experiences.'
    },
    {
      id: 'multiplayer',
      name: 'Multiplayer',
      level: 'Level 88',
      icon: '🌐',
      unlocked: true,
      master: false,
      position: 'center-bottom',
      description: 'Experience with Photon PUN 2, Unity Netcode, and real-time multiplayer game development.'
    },
    {
      id: 'project-management',
      name: 'Project Management',
      level: 'Level 80',
      icon: '🎯',
      unlocked: true,
      master: false,
      position: 'left-middle',
      description: 'Led multiple game development projects from concept to completion with agile methodologies.'
    },
    {
      id: 'design-patterns',
      name: 'Design Patterns',
      level: 'Level 85',
      icon: '🏗️',
      unlocked: true,
      master: false,
      position: 'right-middle',
      description: 'Expert in software design patterns, SOLID principles, and clean architecture for game development.'
    },
    {
      id: 'game-design',
      name: 'Game Design',
      level: 'Level 85',
      icon: '🎨',
      unlocked: true,
      master: false,
      position: 'left-bottom',
      description: 'Strong understanding of game mechanics, user experience, and interactive design principles.'
    }
  ];

  return (
    <section id="skills" className="game-section">
      <div className="skill-tree">
        <h2 className="section-title">Skill Tree</h2>

        <div className="skill-tree-container">
          <canvas 
            ref={canvasRef}
            className="skill-connections"
          />

          <div className="skill-nodes">
            {skills.map((skill) => (
              <div 
                key={skill.id} 
                className={`skill-node ${skill.position} ${skill.unlocked ? 'unlocked' : ''} ${skill.master ? 'master' : ''}`}
              >
                <div className="skill-node-content">
                  <div className="skill-icon">{skill.icon}</div>
                  <div className="skill-info">
                    <div className="skill-name">{skill.name}</div>
                    <div className="skill-level">{skill.level}</div>
                  </div>
                  <div className="skill-glow"></div>
                </div>
                <div className="skill-tooltip">
                  <div className="tooltip-content">
                    <h4>{skill.name}</h4>
                    <p>{skill.description}</p>
                    <div className="tooltip-level">{skill.level}</div>
                  </div>
                </div>
              </div>
            ))}
          </div>

          <div className="skill-tree-legend">
            <div className="legend-item">
              <div className="legend-icon master"></div>
              <span>Master Level</span>
            </div>
            <div className="legend-item">
              <div className="legend-icon unlocked"></div>
              <span>Unlocked</span>
            </div>
            <div className="legend-item">
              <div className="legend-icon locked"></div>
              <span>Locked</span>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default SkillTree;
